INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5010026513014', 'Mornflake Instant Porridge Oat Sachets', 'Grains entiers de flocons d\'avoine 100%. Peut contenir des traces de fruits à coque et soja. Mode d\'emplpj : Au micro-ondes : Découpez délicatement !e haut du sachet et versez le contenu dans un récipient adapté Remplissez le sachet vide de lait froid jusqu\'au trait limite indiqué (environ 180ml) et mélangez-le avec l\'evctne dans le récipient. Faire chauffer 1 minute au micro-ondes à 800w. Mélangez puis refaire chauffer 1 minute. Faire reposer 1 nàinute. A la casserole : Découpez délicatement le haut du sachet et versez le contenu dans une casserole. Remp!issez te sachet vide de lait froid jusau\'au trait limite indiqué (environ 180ml) et versez-le dans la casserole. Parer à ébullition puis laissez mijoter pendant 2 minutes ou jusqu\'à ce que tout le tait soit absorbé, en remuant de temps en temps. A conserver dans un endroit sec et frais. A consommer de préférence avant le : voir sur le paquet. Importé et distribué par Eric Bun, 14 rue Gambetta, Le Mesnil Le Roi, 78600 Maisons-Laffitte, france, Téi : 01 30 22 91 91, www.ericbur.fr', '', '8.4', '1.3', '56.1', '1', '9.1', '12.1', '0.01', '0.00393700787401575', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5010026514110', 'Oatbran Granola', '_Flocons d\'avoine_ entière (34%), _son d\'avoine_ grillée et _son d\'avoine_ (16%), miel (11%), raisins flamme (9%), mélange de graines (8%) (graines de citrouille, graines de tournesol, graines de lin doré), pommes séchées (5%), (contient conservateur _dioxyde de sulfure_), huile de palme, jus de pomme concentré (3%), noix de coco grillée (1.5%), arôme naturel, poudre de sirop de sucre caramélisé. _Son d\'avoine_ grillée : contient des antioxydants (palmipate ascorbique, alpha-tocophérol)), émulsifiant (mono- et diglycérides d\'acides gras), acide citrique.', 'https://static.openfoodfacts.org/images/products/501/002/651/4110/front_fr.3.400.jpg', '14.9', '5', '56.7', '22.2', '10.2', '10.8', '0.03', '0.0118110236220472', '', '1');

