VALUES ('5010026514127', 'Oatbran granola', '(FR) FLOCONS D\'AVOINE entière Mornflake (36%), SON D\'AVOINE grillée et SON D\'AVOINE (17%), mélange de NOIX (13%) (AMANDES effilées, NOISETTES hachées grillées, NOIX DE PECAN), miel (11%), mélange de graines (8.5%) (graines de citrouille, graines de tournesol, graines de lin doré), huile de palme , jus de pomme concentré (3%), arôme naturel, poudre de sirop de sucre caramélisé. SON D\'AVOINE grillée : contient des antioxydants (palmitate ascorbique, atpha-tocophérot), émulsifiant (mono- et diglycérides d\'acides gras), acide citrique.', 'https://static.openfoodfacts.org/images/products/501/002/651/4127/front_fr.21.400.jpg', '20.7', '3.9', '48.5', '8.4', '9.9', '14', '0', '0', '0', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5010026514158', 'Oatbran muesli Cranberry & nut', 'Mélange de fruits secs et de fruits sucrés (28%) (raisins, raisins sultans, canneberges sucrées séchées, abricots secs (contient conservateur _dioxyde de sulfure), pommes séchées (contient conservateur _dioxyde de sulfure_)), flocons d\'avoine_ entière mornflake (28%), son d\'avoine_ grillée (19%), pétales_de_blé_entier_grillés, mélange de noix (4,5%) (_amandes_ effilées, _noisettes_), mélange de graines (4,5%) (graines de citrouille, graines de tournesol). Canneberges sucrées séchées : contiennent canneberges, sucre, huile de tournesol. Son d\'_avoine_ grillée : contient des antioxydants (palmitate ascorbique, alpha-tocophérol), émulsifiant (mono- et diglycérides d\'acides gras), acide citrique.', 'https://static.openfoodfacts.org/images/products/501/002/651/4158/front_fr.3.400.jpg', '9.6', '1.2', '54.6', '17.2', '10', '11.6', '0.03', '0.0118110236220472', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5010026514295', 'Oatbran Crisp ', 'Flocons d\'avoine entière (40%), sucre, raisins (13%) (raisins flamme et raisins), son d\'avoine grillée (12%), riz croustillant (6%), huile de palme, amandes effilées (2%), arôme naturel, poudre de sirop de sucre caramélisé. Son d\'avoine grillée : contient des antioxydants (palmitate ascorbique, alpha-tocophérol), émulsifiant (mono-et diglycérides d\'acides gras), acide citrique. Riz croustillant : contient farine de riz, sucre, extrait de malt d\'orge, pourdre à lever (carbonate de calcium), huile de tournesol, émulsifiant (lécithine de tournesol).', 'https://static.openfoodfacts.org/images/products/501/002/651/4295/front_fr.11.400.jpg', '12', '4.4', '59', '24.9', '7.1', '7.9', '0.03', '0.0118110236220472', '', '1');

